// Country.js

import React from 'react';
import Select from 'react-select';
import { LetterOption } from './menus/options'; // Importing LetterOption from options.js
import './DropdownStyles.css'


const OriginDropdown = ({ options, onSelectOrigin }) => {
    return (
        <div className="dropdown-container">
            <label className="dropdown-label">Select Origin</label>
            <Select options={options} onChange={onSelectOrigin} />
        </div>
    );
};

export default OriginDropdown;
